                animate={{ opacity: 1, scale: 1 }}
                transition={{ duration: 0.5 }}>
                <div className='p-6 min-w-screen max-w-6xl container mx-auto grid grid-cols-4 gap-5 bg-new-slate rounded-lg'>
                    <Note />
                    <Note />
                    <Note />
                    <Note />
                    <Note />
                    <Note />
                </div>
            </motion.div>
        </>
    )
};

export default NotesList;
